import Header from './Header';
import Video from './Video';
import Footer from './Footer';
import Logo from './Logo';

import './Kotyatki.css';

function Kotyatki() {
  return (
    <>
      <Header></Header>
      <Logo></Logo>
      <Video></Video>
      <Divider></Divider>
      <Gallery></Gallery>
      <About></About>
      <Footer></Footer>
    </>
  );
}

export default Kotyatki;
